import operator
import re

def getCorrectedText(text):
    try:
        correctText = re.sub(r'\.', '_', text).replace('.', ' ')
    except (TypeError, KeyError):
        pass

    if correctText is None:
        return None
    return operator.substitute(correctText, '<', '<>', '\n')

